window.bookSummaryJSON = "<p>Ahren can hardly believe his luck. His apprenticeship finally comes to an end, and Khara's interest in him is growing by the minute. He and his companions leave the Southern Jungles and sail westward, this time in search of two Paladins, who are apparently living a peaceful existence on one of the Isles of the Cutlass Sea.</p> <p>Yet their quest proves full of difficulties, for a war among the pirates has transformed the Cutlass Sea into a bubbling cauldron, hiding its own tragic drama. While Ahren and his friends do their utmost to win over the two Paladins in their attempts to defeat HIM, WHO FORCES, the High Fang, SVEN, is nearing the consummation of his fiendish plan.</p>"; 
